<html class="must">
<head>
    <title>Lets play the game</title>
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
    	html
    	{
    		width: auto;
    	}
        .must
        {
            box-sizing: border-box;
        }
    	body
    	{
    		background: #000000;
    		margin: 0px;
    		width: auto;
    		overflow-x: hidden;
    	}
    	#headPage
    	{
    		width: 100vw;
    		height: 100vh;
    		display: grid;
    		grid-template-columns: auto;
    		box-sizing: border-box;
    	}
    	#headSvg
    	{
    		box-sizing: border-box;
    		width: 95vh;
    		height: 95vh;
    		overflow: hidden;
    		margin: auto;
    		border: 10px solid black;
    		border-radius: 10px;
    		box-shadow: 0px 0px 35px 10px white;
            animation-name: svgboxshadow;
            animation-duration: 0.5s;
            animation-iteration-count: infinite;
            animation-timing-function: linear;
    	}
        @keyframes svgboxshadow
        {
            0%{box-shadow: 0px 0px 35px 10px white;}
            50%{box-shadow: 0px 0px 15px 1px white;}
            100%{box-shadow: 0px 0px 35px 10px white;}
        }
    	@media only screen and (max-width: 800px)
    	{
    		#headSvg
	    	{
	    		box-sizing: border-box;
	    		width: 100vw;
	    		height: 100vh;
	    		align-content: center;
	    		border: 0px;
	    		box-shadow: 0px 0px 35px 10px black;
	    	}
	    	#headSvg svg
	    	{
	    		position: relative;
	    		left: -20.5vh;
	    	}
    	}
    	#headSvg svg
    	{
    		height: 100%;
    		width: auto;
    	}
        .hold
        {
            height: 300vh;
        }
    	#LetsPage
    	{
            position: sticky;
            top: 0px;
    		width: 100vw;
    		height: 100vh;
    		background: red;
    		display: grid;
    		grid-template-columns: auto;
            animation-name: letsbg;
            animation-duration: 3s;
            animation-iteration-count: infinite;
            animation-timing-function: ease;
    	}
        @keyframes letsbg
        {
            0%{background: red ;text-shadow: -5px 0px 10px black;padding-top: 0px; }
            85%{background: tomato ;text-shadow: -5px 0px 10px white;padding-top: 0px;}
            90%{background: white ;text-shadow: -5px 0px 10px black;padding-top: 30px;}
            100%0%{background: red ;text-shadow: -5px 0px 10px black;padding-top: 0px;}
        }
    	.LetsTitle
    	{
    		text-align: center;
    		font-size: 100px;
    		margin: auto;
            position: relative;
            z-index: 1;
    	}
        #animationtile,#animationtile2,#animationtile3,#animationtile4
        {
            width: 100%;
            height: 20vh;
            position: absolute;
            z-index: 2;
            box-shadow: 0px 0px 5px 5px black;
            filter: blur(6px);
            background-image: url("images/bglptg.png");
            background-size: cover;
            background-position: center;
            background-attachment: fixed;
            animation-name: animatedtile;
            animation-duration: 3s;
            animation-iteration-count: infinite;
            animation-timing-function: ease;
        }
        @media only screen and (max-width: 800px)
        {
            .LetsTitle
            {
                font-size: 10vh
            }
             #animationtile,#animationtile2,#animationtile3,#animationtile4
             {
                background-image: url("images/bglptgm.png");
             }
        }
        #animationtile2
        {
            animation-direction: alternate-reverse;
            z-index: 0;
        }
         #animationtile3
        {
            animation-delay: 1s;
            z-index: 0;
        }
         #animationtile4
        {
            animation-delay: 2s;
            animation-direction: alternate-reverse;
            background: orange;
            z-index: 0;
        }
        @keyframes animatedtile
        {
            0%{top: 0vh;transform: scale(1); }
            50%{top: 80vh;transform: scale(1); }
            100%{top: 0vh;transform: scale(1);}
        }
        .block
        {
            width: 100vw;
            height: 100vh;
            position: fixed;
            top: 0px;
            z-index: 4;
        }
        #hand
        {
            position: absolute;
            top: 10vh;
            z-index: 0;
        }
        #hand img
        {
            width: 50%;
        }
        @media only screen and (max-width: 800px)
        {
            #hand
            {
                display: none;
            }
        }
        #thegame
        {
            height: 100vh;
            background: orange;
        }
        .formCont
        {
            width: 100%;
            padding-top: 20vh;
            padding-left: 50vw;
            position: relative;
            z-index: 5;
        }
        .form
        {
            box-sizing: border-box;
            width: 40vw;
            max-width: 350px;
            margin: 0px;
            background: black;
            border-radius: 10px;
            padding: 10px;
            color: white;
            font-size: 2vw;
        }
        .form  input
        {
            box-sizing: border-box;
            margin: auto;
            width: 100%;
            height: 2.6vw;
            border-radius: 20px;
            padding: 20px;
            font-weight: 600;
        }
        .form #submit
        {
            float: right;
            width: 35%;
            width: 35%;
            margin-top: 20px;
            padding-top: 10px;
            padding-bottom: 10px;
            background: red;
            font-size: 2vw;
            border-radius: 20px;
        }
        @media only screen and (max-width: 800px)
        {

            .form #submit
            {
                font-size: 2vh;
            }
            .formCont
            {
                
                padding: 10px;
                display: grid;
                width: 100vw;
                height: 100vh;
                grid-template-columns: auto;
            }
            .form
            {
                width: 90vw;
                margin: auto;
                font-size: 2vh;
            }
        }
    </style>
</head>

<script type="text/javascript">
    var toggle=0;togglespeed=0;
    var index = setInterval(cngindex,4000);
    var animationtile =  document.getElementById('animationtile');
    var animationtile2 = document.getElementById('animationtile2');
    var animationtile3 = document.getElementById('animationtile3');
    var animationtile4 = document.getElementById('animationtile4');
    function cngindex() {
        togglespeed++;
        if(toggle===0) {
           animationtile.style.zIndex = 2;
           animationtile2.style.zIndex = 0;
           animationtile3.style.zIndex = 1;
           animationtile4.style.zIndex = 2;
           toggle=1;
        }
        else if(toggle===1) {
           animationtile.style.zIndex = 0;
           animationtile2.style.zIndex = 1;
           animationtile3.style.zIndex = 2;
          animationtile4.style.zIndex = 0;
           toggle=0;
        }
        }          
        var decspeed = setInterval(fordecspeed,8000);
        function fordecspeed () {
            animationtile.style.animationDuration = "30s";
            animationtile2.style.animationDuration = "40s";
            animationtile3.style.animationDuration = "50s";
            animationtile4.style.animationDuration = "60s";
            var norspeed = setTimeout(fornorspeed,4000);
            function fornorspeed() {
                animationtile.style.animationDuration = "3s";
                animationtile2.style.animationDuration = "3s";
                animationtile3.style.animationDuration = "3s";
                animationtile4.style.animationDuration = "3s";   
            }
            }
</script>
